import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ViewPackages = () => {
  const [packages, setPackages] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchPackages = async () => {
      try {
        const response = await axios.get('http://localhost:8081/package/get-package');
        setPackages(response.data);
      } catch (error) {
        console.error('Error fetching packages:', error);
        setError('Failed to fetch packages.');
      }
    };

    fetchPackages();
  }, []);

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Packages List</h1>
      {error ? (
        <p style={styles.error}>{error}</p>
      ) : (
        <table style={styles.table}>
          <thead>
            <tr>
              <th style={styles.th}>ID</th>
              <th style={styles.th}>Courier</th>
              <th style={styles.th}>Delivery Address</th>
              <th style={styles.th}>Pay on Delivery</th>
              <th style={styles.th}>Status</th>
            </tr>
          </thead>
          <tbody>
            {packages.map((pkg) => (
              <tr key={pkg.id}>
                <td style={styles.td}>{pkg.id}</td>
                <td style={styles.td}>{pkg.courier?.name || 'N/A'}</td>
                <td style={styles.td}>{pkg.deliveryAddress}</td>
                <td style={styles.td}>{pkg.payOnDelivery ? 'Yes' : 'No'}</td>
                <td style={styles.td}>{pkg.status}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '800px',
    margin: '50px auto',
    padding: '20px',
    border: '1px solid #ccc',
    borderRadius: '10px',
    backgroundColor: '#f5e9e5',
  },
  title: {
    textAlign: 'center',
    color: '#d4849a',
    marginBottom: '20px',
  },
  error: {
    color: 'red',
    textAlign: 'center',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
  },
  th: {
    border: '1px solid #d4849a',
    padding: '10px',
    backgroundColor: '#f8d3e5',
    color: '#6e6e6e',
    textAlign: 'left',
  },
  td: {
    border: '1px solid #d4849a',
    padding: '10px',
    textAlign: 'left',
  },
};

export default ViewPackages;
